import React, { Component } from "react";
import "./Exchange.css";
class Exchange extends Component {
  render() {
    return (
      <div className="row">
        <div className="row-5"></div>
        <div className="row-2"></div>
        <div className="row-5"></div>
      </div>
    );
  }
}
export default Exchange;
